import {useState} from 'react'
import { useParams } from 'react-router-dom'
import axios from 'axios'


function Book() {
    const[books,setbooks]=useState([])
    const { id }= useParams()

    async function fetchData(){
    try{
   const res=await axios.get("http://localhost:3001/books")
   setbooks(res.data)
    }catch(err){
      console.log(err)
    }
  }
  useEffect(()=>{
    fetchData()
    },[])
  return (
    <div>Book { id }</div>
  )
}

export default Book
